CREATE TABLE "NMT2"."LOGG"
(
    LOGG_ID NUMBER PRIMARY KEY NOT NULL,
    MOTTAK_ID varchar2(50) NOT NULL,
    HENDELSE_ID NUMBER NOT NULL,
    TILLEGSINFO varchar2(3000),
    HENDELSEDATO timestamp NOT NULL,
    STATUSLEVEL NUMBER DEFAULT 0  NOT NULL
);
ALTER TABLE "NMT2"."LOGG"
    ADD CONSTRAINT LOGG_HENDELSE
        FOREIGN KEY (HENDELSE_ID)
            REFERENCES "HENDELSE"(HENDELSE_ID);
ALTER TABLE "NMT2"."LOGG"
    ADD CONSTRAINT LOGG_MELDING
        FOREIGN KEY (MOTTAK_ID)
            REFERENCES "MELDING"(MOTTAK_ID);

